    data: |
      SELECT col2 + + col0 AS col2 FROM tab2 WHERE + col2 + - col2 NOT BETWEEN - col0 * + col2 + + col0 AND - col2 * + col2;
  - name: tab2

outputs:
  - name: q943.out
    data: |
      104
      117
      34
